function filter_flow_list(flow_list, size){
  var sorted_list = flow_list.sort(function(a, b){
    return (a['stat']['revenue'] < b['stat']['revenue']) ? -1 : 1;
  });
  var a1 = sorted_list.slice(0, size);
  var a2 = sorted_list.slice(sorted_list.length - size, sorted_list.length);
  return a1.concat(a2);
}

/**
 * 获取唯一用户列表
 */
var user_list = get_user_list(flow_list);

function get_user_list(flow_list) {
	var user_list = [];
	var name_set = new Set();
	for (var i = 0; i < flow_list.length; i++) {
		var user = flow_list[i]['user'];
		if (! name_set.has(user['name'])) {
			user_list.push(user);
			name_set.add(user['name']);
		}
	}
	return user_list;
}

/**
 * 获取唯一商家列表
 */
var poi_list = get_poi_list(flow_list);

function get_poi_list(flow_list) {
	var poi_list = [];
	var name_set = new Set();
	for (var i = 0; i < flow_list.length; i++) {
		var poi = flow_list[i]['poi'];
		if (! name_set.has(poi['name'])) {
			poi_list.push(poi);
			name_set.add(poi['name']);
		}
	}
	return poi_list;
}

var map = new AMap.Map('container',{
            resizeEnable: true,
            zoom: 14,
            center: [user_list[0]['lng'], user_list[0]['lat']]
        });

AMap.plugin(['AMap.ToolBar','AMap.Scale','AMap.OverView'],
	function(){
        map.addControl(new AMap.ToolBar());
        map.addControl(new AMap.Scale());
});

var infoWindow = new AMap.InfoWindow({
          closeWhenClickMap: true
});

// step 1. plot user and poi
for (var i = 0; i < user_list.length; i++) {
	var user = user_list[i];
	var circleMarker = new AMap.CircleMarker({
          center:[user['lng'], user['lat']],
          radius:8,
          strokeColor:'white',
          strokeWeight:2,
          strokeOpacity:0.5,
          fillColor:'rgba(255,0,0,1)',
          fillOpacity:0.5,
          zIndex:10,
          bubble:true,
          cursor:'pointer',
          clickable: true
        });
  circleMarker.setMap(map);
	circleMarker.ctnt = '名称: ' + user['name'];
	circleMarker.on('click', markerClick);
	circleMarker.emit('click', {target: circleMarker});
}

for (var i = 0; i < poi_list.length; i++) {
	var poi = poi_list[i];
	var circleMarker = new AMap.CircleMarker({
          center:[poi['lng'], poi['lat']],
          radius:8,
          strokeColor:'white',
          strokeWeight:2,
          strokeOpacity:0.5,
          fillColor:'rgba(0,0,255,1)',
          fillOpacity:0.5,
          zIndex:10,
          bubble:true,
          cursor:'pointer',
          clickable: true
        });
    circleMarker.setMap(map);
	circleMarker.ctnt = '名称: ' + user['name'];
	circleMarker.on('click', markerClick);
	circleMarker.emit('click', {target: circleMarker});
}

function markerClick(e) {
	infoWindow.setContent(e.target.ctnt);
	infoWindow.open(map, e.target.getCenter());
}

// step 2. plot line
for (var i = 0; i < flow_list.length; i++) {
	var flow = flow_list[i];
	var lineArr = [[flow['user']['lng'], flow['user']['lat']], [flow['poi']['lng'], flow['poi']['lat']]];
  var line_color = get_line_color(flow['stat']);
  var line_weight = get_line_weight(flow['stat']);
	var polyline = new AMap.Polyline({
        path: lineArr,          //设置线覆盖物路径
        strokeColor: line_color, //线颜色
        strokeOpacity: 1,       //线透明度
        strokeWeight: line_weight,        //线宽
        strokeStyle: "solid",   //线样式
        strokeDasharray: [10, 5] //补充线样式
    });
    polyline.ctnt = '用户: ' + flow['user']['name'] + '<br/>商家: ' + flow['poi']['name'] + '<br/>总盈亏:' + flow['stat']['revenue'] + '<br/>月单量:' + flow['stat']['ordnum'] + '<br/>单均盈亏:' + flow['stat']['revenue'] / flow['stat']['ordnum'] + '<br/>单均收入:' + flow['stat']['income'] + '<br/>单均骑手补贴:' + flow['stat']['riderfee'];
    polyline.centerPoint = {'lng': (flow['user']['lng'] + flow['poi']['lng']) / 2, 'lat': (flow['user']['lat'] + flow['poi']['lat']) / 2}
    polyline.on('click', lineClick);
    polyline.emit('click', {target: polyline});
    polyline.setMap(map);
}

function lineClick(e) {
	infoWindow.setContent(e.target.ctnt);
	infoWindow.open(map, new AMap.LngLat(e.target.centerPoint['lng'], e.target.centerPoint['lat']));
}